import React from 'react';

const InputComponent = () => {
  const containerStyle = {
    padding: '30px',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  const inputStyle = {
    padding: '0.5em',
    width:'1em'
  };

  return (
    <div style={containerStyle}>
      <input type="text" style={inputStyle} />
    </div>
  );
};

export default InputComponent;
